import React, { Component }  from 'react';

class Logo extends Component {
  render() {
    return (
      <div style={{ paddingBottom: '6%' }}>
        <h1>Kimberly</h1>
        <h1>Risk</h1>
        <h1>Studio</h1>
      </div>
    );
  }
}

export default Logo;
